//bottom-up solution
class Solution {
public:
    int maxSubArray(vector<int>& nums) {
        int maxVal = nums[0];
        int sum = nums[0];

        for(int i=1; i<nums.size(); i++){
            int temp = sum + nums[i];
            if(temp > nums[i]){
                sum = temp;
            }else{
                sum = nums[i];
            }
            maxVal = max(maxVal, sum);
        }

        return maxVal;
    }
};
